db: tests-examples/db2csv/student_transcripts_tracking/tables/student_transcripts_tracking.sqlite
inputs:
 - tests-examples/db2csv/student_transcripts_tracking/tables/students.csv
 - tests-examples/db2csv/student_transcripts_tracking/tables/student_enrolment.csv
output: tests-examples/db2csv/student_transcripts_tracking/tables/0036_dev.csv
raw_question: What is the first, middle, and last name, along with the id and number of enrollments, for the student who enrolled the most in any program? 
question_index: 542 
join_columns:
 - student_id
groupby_columns:
 - student_id
functions:
 - max
 - count
comment: |-
  SELECT T1.student_id,
         T1.first_name,
         T1.middle_name,
         T1.last_name,
         count(*),
         T1.student_id
  FROM Students AS T1
  JOIN Student_Enrolment AS T2 ON T1.student_id = T2.student_id
  GROUP BY T1.student_id
  ORDER BY count(*) DESC
  LIMIT 1

sql: |-
  SELECT T1.student_id,
         T1.first_name,
